    background: '#3f51b5',
    minHeight: 50,
    lineHeight: 3.5,
    fontSize: '1.2rem',
    color: 'white',
    padding: '0 20px',
  },
  content: {
    padding: 20,
  },
};

export default function Footer() {

    return (
      <div className="icons">
        <a href="https://github.com/KarenHarley"><i class='bx bxl-github'></i></a>
